import React from 'react';
import './App.css';
import {FormattedMessage} from 'react-intl';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p><FormattedMessage id="home.welcome"/></p>
      </header>
    </div>
  );
}

export default App;
